--Ajustes do relacionamento entre cidades e comarcaS de acordo com o SPG
SELECT 'INSERT INTO COMARCA_CIDADE (ID_COMARCA, ID_CIDADE) VALUES (' || C.ID_COMARCA || ',' || CD.ID_CIDADE || ');'
FROM PROJUDI.COMARCA C JOIN PROJUDI.CIDADE_COMARCA_SPG CCS ON CCS.COMARCA = C.COMARCA_CODIGO
JOIN PROJUDI.CIDADE CD ON CD.CODIGO_SPG = CCS.CODIGO
WHERE NOT EXISTS (SELECT 1 FROM PROJUDI.COMARCA_CIDADE CC WHERE CC.ID_CIDADE = CD.ID_CIDADE)


--Gerar inserts para a tabela REGIÃO que possuem região cadastrada no SPG
SELECT DISTINCT 'INSERT INTO REGIAO (REGIAO_CODIGO, REGIAO, ID_COMARCA, CODIGO_TEMP) VALUES (' || TO_NUMBER(TRIM((T1.CODIGO || TRIM(TO_CHAR(T6.COMARCA_CODIGO, '000'))))) || ',''' || T1.DESCRICAO || ''',' || T6.ID_COMARCA || ',' || T1.CODIGO || ');'
FROM PROJUDI.REGIAO_SPG T1 INNER JOIN PROJUDI.ZONA_BAIRRO_SPG T2 ON T2.REGIAO_CIVEL = T1.CODIGO
INNER JOIN PROJUDI.BAIRRO T3 ON T3.CODIGO_SPG = TO_NUMBER(TRIM(TRIM(TO_CHAR(CODIGO_MUNICIPIO, '0000000')) || TRIM(TO_CHAR(CODIGO_BAIRRO,'00000'))))
INNER JOIN PROJUDI.CIDADE T4 ON T3.ID_CIDADE = T4.ID_CIDADE
INNER JOIN PROJUDI.COMARCA_CIDADE T5 ON T4.ID_CIDADE = T5.ID_CIDADE
INNER JOIN PROJUDI.COMARCA T6 ON T5.ID_COMARCA = T6.ID_COMARCA


--Gerar inserts para a tabela REGIÃO que NÃO possuem região cadastrada no SPG
SELECT DISTINCT 'INSERT INTO REGIAO (REGIAO_CODIGO, REGIAO, ID_COMARCA, CODIGO_TEMP) VALUES (' || TO_NUMBER(TRIM(TO_CHAR(T6.COMARCA_CODIGO, '000'))) || ',''' || 'REGIAO I - VARIAS ZONAS' || ''',' || T6.ID_COMARCA || ',0);'
FROM PROJUDI.ZONA_BAIRRO_SPG T2
INNER JOIN PROJUDI.BAIRRO T3 ON T3.CODIGO_SPG = TO_NUMBER(TRIM(TRIM(TO_CHAR(CODIGO_MUNICIPIO, '0000000')) || TRIM(TO_CHAR(CODIGO_BAIRRO,'00000'))))
INNER JOIN PROJUDI.CIDADE T4 ON T3.ID_CIDADE = T4.ID_CIDADE
INNER JOIN PROJUDI.COMARCA_CIDADE T5 ON T4.ID_CIDADE = T5.ID_CIDADE
INNER JOIN PROJUDI.COMARCA T6 ON T5.ID_COMARCA = T6.ID_COMARCA
WHERE T2.ZONA_CIVEL > 0
AND T2.REGIAO_CIVEL = 0
AND NOT EXISTS (SELECT 1 FROM PROJUDI.ZONA_BAIRRO_SPG T7 WHERE T2.CODIGO_MUNICIPIO = T7.CODIGO_MUNICIPIO AND T7.REGIAO_CIVEL > 0)



